import logo from './logo.svg';
import './index.css';
import { BiHomeAlt2, BiUser, BiInfoCircle, BiLogOut } from "react-icons/bi";
import { FiFeather } from "react-icons/fi";


function App() {
  return (
    <div className="App">
      <nav className="h-screen w-16 bg-gray-500 flex flex-col items-center">
        <FiFeather />
        <hr className='' />
        <BiHomeAlt2 />
        <BiUser />
        <BiLogOut />
        <hr />
        <BiInfoCircle />

      </nav>
    </div>
  );
}

export default App;
